INSERT INTO `product` VALUES (1,1,'듀랑고','듀랑고 쉘터',576000,'tent',0,'쉘터 텐트는 야외 활동을 더욱 쾌적하고 편안하게 즐길 수 있는 이동식 보호구입니다',10,0,'def2557e-9133-4e29-910b-2654a0e62c3b.C1DA20500_1000.jpg'),(2,1,'듀랑고','듀랑고 에어미니',378000,'tent',1,'듀랑고 에어미니는 야외 활동을 더욱 즐겁게 만들어줄 작고 강력한 텐트입니다. 이 텐트는 손쉬운 설정과 휴대성을 결합하여 모험가들에게 최적의 선택입니다.',10,0,'74e60dad-5953-49e7-8ef1-c615ff211db4.C1DA20900_1000 (2).jpg'),(3,1,'듀랑고','롯지12',970000,'tent',1,'롯지12 텐트 (Lodge12 Tent)\"는 자연 속에서의 휴가와 캠핑을 즐기고자 하는 모험가들을 위한 최고의 텐트입니다. 이 텐트는 훌륭한 디자인, 내구성, 그리고 편안함을 제공하여 자연과 가까운 경험을 선사합니다',10,0,'a29b88cb-3522-4523-95bc-2e70ab9ea698.1557999289196m0.jpg'),(4,1,'듀랑고','캐빈 라이트',1062000,'tent',1,'캐빈라이트 (Cabin Light)\"는 현대적이고 실용적인 조명 솔루션으로, 캠핑, 야외 활동, 그리고 긴 여정을 더욱 편안하게 만들어주는 제품입니다',10,0,'365360fa-6437-402f-8b6d-cbe936f3534e.1557996119165m0.jpg'),(5,1,'듀랑고','캐빈 와이드',1245000,'tent',0,'캐빈와이드 텐트(Cabin Wide Tent)\"는 넓은 실내 공간과 탁트인 천막 높이로 편안한 캠핑 환경을 제공합니다. 내부 구조는 분리된 침실과 거실로 구성되어 가족 및 친구와 함께 사용하기에 이상적입니다',10,0,'18d04158-7895-4c5b-8985-114dea4e30de.1566283497173m0.jpg'),(6,1,'듀랑고','모던라운드 테이블',67000,'table',1,'모던 라운드 테이블은 현대적이고 세련된 디자인의 원형 테이블입니다. 그레이나 화이트 컬러 옵션으로 제공되어, 다양한 인테리어 스타일에 잘 어울립니다',20,0,'5d506dd7-4e7b-4d85-a60f-57ec3e2dd571.1000000175_detail_275.jpg'),(7,1,'듀랑고','우드라인테이블',56000,'table',1,'우드라인 테이블은 자연의 아름다움과 현대적인 디자인이 결합된 야외 가구입니다. 테이블 상판은 내구성 있는 우드 소재로 만들어져서 오랜 시간 사용해도 변형되지 않는 제품입니다.',20,0,'ad6654de-bcc6-4637-9014-d091dcd486db.969e80b28c400f5de318f9977300aa1a.jpg'),(8,1,'듀랑고','와이드 그릴 테이블	',79000,'table',1,'와이드 대형 그릴 테이블은 캠핑 및 야외 활동을 위한 완벽한 동반자입니다. 이 테이블은 그릴을 통합한 형태로, 식사를 준비하고 조리하고 그릴 요리를 할 수 있는 편리한 공간을 제공합니다.',20,0,'a94fc0ba-842c-40a5-befa-9173a1709671.1000000166_detail_075.jpg'),(9,1,'듀랑고','3-way 테이블',259000,'table',1,'3-way 테이블은 다용도로 사용할 수 있는 다기능 테이블로, 그 이름처럼 3가지 다른 방식으로 사용할 수 있습니다.',20,0,'3d2f4f08-a66b-4a94-9c2f-a91d6823ac5f.1000000217_detail_498.jpg'),(10,1,'듀랑고','올리브 에고테이블',88000,'table',1,'올리브에고 테이블은 훌륭한 디자인과 탁월한 내구성으로 제작된 다용도 테이블입니다. 이 테이블은 현대적인 인테리어에 완벽하게 어울리며, 다양한 용도로 활용 가능합니다',20,0,'23b96dca-287d-43b7-a60f-cded85437645.8a0ac5f62b54df452d8ba67f752efe8f.jpg'),(11,1,'듀랑고','휴대용 와인잔',16000,'tableware',1,'휴대용 와인 잔 세트는 와인 애호가나 야외 활동을 즐기는 분들을 위한 완벽한 동반품입니다. 이 세트는 주로 내구성 있는 플라스틱, 유리, 또는 스테인레스 스틸로 만들어져서 가벼우면서도 뛰어난 내구성을 자랑합니다',20,0,'436cad72-d3a0-4568-a94e-83ace4bcb074.1000000233_detail_029.jpg'),(12,1,'듀랑고','와이드 캠핑반합',38000,'tableware',0,'와이드 캠핑밴(Wide Camping Van)은 활기찬 야외 생활을 즐기고자 하는 모험가와 캠핑 애호가를 위한 완벽한 선택입니다. 이 넓은 밴은 편안한 여행을 위해 모든 편의 시설을 갖추고 있으며, 슬라이드 아웃 침실과 주방, 현대적이고 스타일리시한 디자인으로 인상을 남깁니다. 와이드 캠핑밴은 자연 속에서의 휴가를 더욱 특별하게 만들어줄 최고의 동반자입니다.',20,0,'035d2781-467c-4a77-bdee-fbfeca008f25.d264a915d3f1f12b89b24eac929c5375.jpg'),(13,1,'듀랑고','휴대 워터탱크',18900,'tableware',1,'휴대용 워터탱크는 야외 활동이나 캠핑, 등산, 여행, 피크닉, 축제 등 다양한 환경에서 물 공급을 편리하게 해주는 휴대용 수납용기입니다. 이 제품은 일반적으로 간편하게 들고 다닐 수 있는 장점과 튼튼한 내구성을 자랑합니다',20,0,'20948745-0f3d-4110-b6aa-04a5aac49674.1000000167_detail_093.jpg'),(14,1,'듀랑고','클래식 캠핑 나이프',27200,'tableware',1,'클래식 캠핑 나이프는 야외 활동 및 캠핑 여행을 위한 필수 도구로, 다양한 용도로 사용할 수 있는 다재다능한 나이프입니다. 이 제품은 주로 캠핑, 등산, 낚시, 하이킹, 피크닉, 서바이벌 등 다양한 곳에 사용할 수 있습니다.',20,0,'08322d67-f598-47b1-ab68-4277d72dd6b0.1000000070_detail_197.jpg'),(15,1,'듀랑고','듀랑고 무빙 냉장고',319600,'accessory',1,'듀랑고 무빙 냉장고는 야외 활동, 캠핑, 여행 및 휴가 중에 음식 및 음료를 신선하게 보관하는 데 사용되는 휴대용 전기 냉장고입니다',20,0,'2e816b1e-e0ba-47d1-850e-05c6f42d0382.1000000057_main_053.jpg'),(16,1,'듀랑고','듀랑고 백패킹 삽	',9000,'accessory',1,'삽 부분은 전체적으로 U자 라인으로 주걱처럼 좁아지는 형태로 귀퉁이에 각이 져 있어 뼈대 역할을 하므로 잘 휘지 않도록 만들어졌습니다.	',20,0,'981c6248-89f5-4e47-8d04-69c79bb49d5c.36cdb13002d8e4acc13d615196541a36.jpg'),(17,1,'듀랑고','듀랑고맨	',113900,'accessory',1,'세계적으로 사랑받는 듀랑고맨 기능 툴은 가볍고 일반 주머니 크기의 윙맨은 바깥쪽에서 한손으로 열수있는 블레이드와 새롭게 디자인된 스프링 액션 툴들이 특징입니다',20,0,'10c960cb-97f6-4aaa-b1ea-098e5a136595.a28d4f12a3c66f2648f9901f7588a916.jpg'),(18,1,'듀랑고','커트러리 인서트',25000,'tableware',1,'가볍고 실용적인 피크닉 키트로 어디서든 완벽한 식사가 가능합니다.',20,6,'4e9fd551-91a6-4de1-8d04-cb2ead808581.36a8f7faad3d6e408d3105f62590f055.jpg'),(19,1,'듀랑고','다이캐스팅 해머',26000,'accessory',1,'견고하고 내구성 높은 다이캐스팅 스틸 일정한 금형을 만들어 금형과 똑같은 주물을 얻어내는 정밀주조법인 다이캐스팅은 치수가 정확해 다듬질할 필요가 거의 없는 제품을 생산하는 기법으로 제작되었습니다.',20,15,'7234a720-fa48-4097-b078-cffbc4bd5bee.d576aa61456c03deb589e6dd83c30f78.jpg'),(20,1,'듀랑고','모기향 홀더',29600,'accessory',0,'2개의 홀더가 하나로 콤팩트하게 수납가능 미니멀한 디자인의 감성 모기향홀더입니다.',20,10,'c7d64cc9-205a-4b45-97cf-4d2e388bb767.4ad5d1e01d72bbaa024609b94f660f26.jpg'),(21,1,'듀랑고','에어 쿠션매트',54000,'other',1,'에어매트(air mattress)는 공기로 팽창하는 침대로, 주로 잠자리나 휴식 공간으로 사용됩니다. 다른 이름으로는 에어베드(air bed)라고도 불립니다.',20,10,'1c79bba7-01a7-4ea6-b2c9-bbc9b34db315.1000000156_detail_023.jpg'),(22,1,'듀랑고','인터내셔날 V2',150000,'other',1,'업그레이드 된 듀랑고 인터내셔널 멀티 연료 사용 스토브는 약 20년을 거쳐 인정받아온 최고의 스토브입니다.',20,5,'50c5301c-0aaa-4454-9193-cd34f4856ce2.6076c34401979e9ab77df3402810e60d.jpg'),(23,1,'듀랑고','듀랑고 구이바다',178000,'other',1,'전골팬,바베큐그릴,등 여러가지 음식을 요리할 수 있는 멀티 스토브로 업그레이드. 타원형 중앙 화구가 열 전도율을 높이고 본체 내부로 설계된 화구는 열손실이 적습니다',20,10,'82710af3-71a6-4101-a148-6423434d8ffd.694d80ec319ee392aedf8a5cf445913f.jpg'),(24,1,'듀랑고','듀랑고 케틀',190000,'other',1,'워크 터프 스토브 옆면에 부착하여 물과 음식을 데울 수 있는 케틀. 간단한 국물요리가 가능하며 알루미늄 소재로 부식에 강함. 좌측 수전을 통해 뜨거운 물을 쉽게 담을 수 있습니다.',20,12,'8e6caef9-0ddb-4a7f-b51f-9e52a470d8e2.79a073123426348eda4298ee8e446db4.jpg'),(25,1,'듀랑고','2-버너 가스그릴',1360000,'other',1,'적외선 기술로 그릴의 불꽃튐이 적고 고른 열전도로 적은 가스량으로 많은 요리가 가능하며 풍부한 육즙을 가진 겉바속촉의 바비큐를 완성해드립니다.',10,20,'39e5065a-dbb4-4c2e-ae6e-1e409c433d78.0c3f2e1d9f53c991d55e8ed285ff6cc0.jpg'),(26,1,'듀랑고','듀랑고 썸에어',360000,'tent',1,'썸에어텐트 상품은 캠핑 및 야외 활동을 위한 휴대용 텐트로, 간편한 설정 및 분해로 사용이 간편합니다. 내구성 있는 소재로 만들어져 어떤 날씨에도 안정적으로 사용할 수 있으며, 다양한 크기와 디자인으로 제공되어 다양한 용도로 활용할 수 있습니다. 휴대가 편리하며 자연과 함께하는 캠핑 경험을 더욱 풍부하게 만들어줍니다.',10,20,'46371b22-0291-4343-b790-5802e3a2e452.sum_air300_06.jpg'),(27,2,'코베아','아케디아',1320000,'tent',1,'\"아케디아 텐트는 뛰어난 내구성과 풍부한 기능으로 야외 활동을 위한 완벽한 동반자입니다. 경량 및 쉬운 조립으로 휴대성을 극대화하였으며, 안정적인 구조와 방수 기능으로 다양한 기상 조건에서 안전하게 사용할 수 있습니다. 아케디아 텐트는 모험가들을 위한 최적의 숙소로 디자인되었습니다.\"',10,0,'fd042732-f81b-4ced-a381-4b8b94e202ec.1699368737129m2.jpg'),(28,2,'코베아','와일드 알파카모',820000,'tent',1,'와일드 알파카 모텐트는 혁신적인 디자인과 뛰어난 내구성으로 자연 속에서의 캠핑을 더욱 특별하게 만듭니다. 경량 소재와 간편한 조립으로 여행자들에게 편의성을 제공하며, 넓은 내부 공간과 탁월한 통풍 시스템으로 편안한 숙면을 보장합니다. 와일드 알파카 모텐트는 모험의 시작을 위한 완벽한 동반자입니다.',10,0,'dca473b9-ad07-4ebd-84df-c5cd61fcba35.167895681974m1.jpg'),(29,2,'코베아','아케디아 맥스',1890000,'tent',1,'아케디아 맥스 텐트는 혁신적인 디자인과 고급 소재로 제작된 캠핑 텐트로, 넓은 내부 공간과 탁월한 통풍 시스템을 통해 자연과 조화를 이룹니다. 경량 및 간편한 조립으로 여행자들에게 최적의 이동성을 제공하며, 내구성 있는 구조로 다양한 환경에서 안정적인 숙면을 보장합니다. 아케디아 맥스 텐트는 모험과 휴식을 동시에 즐길 수 있는 최고의 동반자입니다',10,0,'4e78c997-a612-4dd1-a94a-20a94db3360b.16786876327m2.jpg'),(30,2,'코베아','VST 로그 스탠드',39000,'table',1,'VST 로그 스탠드 테이블은 간결하면서도 효과적인 디자인으로 높은 품질의 로그를 손쉽게 가공할 수 있는 기능을 제공합니다. 견고한 구조와 안정성 있는 플랫폼은 다양한 작업 환경에서 편리한 사용을 가능케 하며, 조절 가능한 높이와 각도로 작업자의 편의성을 극대화합니다. VST 로그 스탠드 테이블은 목공 및 가구 제작을 위한 이상적인 작업 도구로 뛰어난 성능과 편의성을 제공합니다.',10,0,'a79891e9-5dd6-473d-bd5f-a4534c97414b.1664979152264m0.jpg'),(31,2,'코베아','큐브패밀리테이블',130000,'table',1,'큐브 패밀리 테이블은 현대적이고 실용적인 디자인으로 다양한 공간에서 활용할 수 있는 다용도 테이블입니다. 강화된 재질로 제작되어 내구성이 뛰어나며, 셀프 어셈블리로 쉽게 조립할 수 있습니다. 간결한 스타일과 다양한 컬러 옵션으로 인테리어에 더욱 매력을 더하는 동시에 효율적인 사용을 가능케 합니다',10,0,'074403e4-805d-4b0e-975d-29e606919bee.1660138518597m0.jpg'),(32,2,'코베아','비스트로 테이블',150000,'table',1,'비스트로 테이블은 트렌디하면서도 실용적인 디자인으로 작은 공간을 활용한 아늑한 식사 공간을 제공합니다. 강화된 소재로 제작되어 내구성이 뛰어나며, 컴팩트한 크기로 다양한 환경에 적합합니다. 고풍스러운 스타일과 실용성을 결합한 비스트로 테이블은 현대적인 라이프스타일을 완벽히 반영합니다.',10,0,'80e15e0c-4fb9-44cc-b182-c67ec74786a6.1648782141762m0.jpg'),(33,2,'코베아','오닉스 키친 툴',37000,'tableware',1,'오닉스 키친 툴은 정교한 디자인과 높은 성능으로 주방 업무를 더욱 효율적으로 수행할 수 있는 도구입니다. 고품질 스테인리스 스틸로 제작되어 내구성이 뛰어나며, 다양한 조리 작업에 적합합니다. 현대적이고 실용적인 디자인으로 오닉스 키친 툴은 요리 경험을 한 단계 높여줍니다',10,0,'4a935983-460e-43ce-91a5-7a511afeb8bc.1581648061570m0.jpg'),(34,2,'코베아','델타 스푼',4000,'tableware',1,'델타 스푼은 실용적이면서도 세련된 디자인으로 소재의 특성을 최대한 살린 주방 도구입니다. 고급 플라스틱 소재로 제작되어 내구성이 뛰어나며, 다양한 조리 작업에 효과적으로 활용할 수 있습니다.',20,0,'acef199c-5345-479b-8bd4-a0c3dfe7864e.1450749076245m0.jpg'),(35,2,'코베아','ST소맥세트',50000,'tableware',1,'ST소맥세트는 스타일리시한 디자인과 높은 품질로 소맥을 즐기기에 이상적인 세트입니다. 내구성 있는 재료로 제작되어 특별한 순간을 더욱 특별하게 만들어주는 소맥 경험을 선사합니다.',10,0,'0a0d2cb0-5a26-44df-b8d3-dd76cd64766a.1352104295_m_0.jpg'),(36,2,'코베아','캐즘 클라이밍',320000,'accessory',1,'캐즘 40 블루는 클라이밍 전용으로 설계된 백팩으로, 뛰어난 내구성과 기능성을 갖추고 있습니다. 40리터 수용량과 38개의 배수구로 다양한 클라이밍 장비를 효율적으로 수납할 수 있습니다. 튼튼한 소재와 심미적인 블루 컬러로 디자인된 이 백팩은 어드벤처한 순간을 더욱 편안하고 스타일리시하게 즐길 수 있도록 제작되었습니다',10,0,'0ae8edd9-84ec-43cd-8393-611566805a69.1557973274858m0.jpg'),(37,2,'코베아','울트라실 나노',23000,'tent',1,'\"울트라실 나노 드라이백은 물에 강하고 내용물을 완벽하게 보호하는 고성능 드라이 백입니다. 나노 테크놀로지로 제작되어 방수 및 방진 기능이 뛰어나며, 가벼운 소재로 제작되어 휴대성이 뛰어납니다. 모험과 여행 중 소중한 물품을 안전하게 보호하고 편리하게 이동할 수 있는 울트라실 나노 드라이백은 다양한 환경에서 활용할 수 있습니다.',10,0,'1688f832-5851-42ed-b95a-a4707fff7f8a.1453791133323m0.jpg'),(38,2,'코베아','택티컬 판쵸',54000,'accessory',1,'택티컬 판쵸는 강화된 소재와 전략적으로 설계된 기능성으로 안전하고 신속한 야외 활동을 지원하는 전술용 백입니다. 다양한 수납 공간과 효율적인 구조로 전술 장비를 손쉽게 조직하고 휴대할 수 있습니다. 견고한 제작과 탁월한 내구성으로 어떤 극한 상황에서도 믿고 사용할 수 있는 택티컬 판쵸는 전문적인 사용자들에게 최적의 선택입니다.',10,0,'8d3e71de-898d-4cc9-840e-ca4187904509.1694412490981m0.jpg'),(39,2,'코베아','듀얼 파워스토브',285000,'other',1,'듀얼 파워스토브는 효율적이고 다목적인 야외 요리를 위해 설계된 고성능 캠핑 스토브입니다. 듀얼 연료 시스템으로 가스와 액체 연료 양쪽을 사용할 수 있어 다양한 환경에서 사용이 가능하며, 빠른 요리 시간과 효과적인 연료 소비를 제공합니다. 가벼우면서도 튼튼한 구조로 캠핑, 등산, 여행 등 다양한 야외 활동에 이상적인 파트너로 활용할 수 있습니다.',10,0,'129cd66d-8dd4-4e6e-9934-6ad1b13f9f9c.1693822777101m0.jpg'),(40,2,'코베아','펜타 스토브',189000,'other',1,'펜타 스토브는 간편한 조립과 높은 가열 효율성으로 야외에서의 요리를 간편하게 만드는 캠핑 스토브입니다. 가스 구동으로 빠른 점화와 조절이 가능하며, 안전한 사용을 위한 실내 및 야외 환경에서 모두 활용할 수 있습니다. 경량이면서도 강화된 소재로 제작되어 이동 중에도 편리하게 사용할 수 있는 펜타 스토브는 다양한 야외 활동에 적합한 휴대용 요리 도구입니다.',10,0,'29c7a06d-2f0d-4878-975e-5ceb8a7e17db.1650875200187m2.jpg');
